import Sidebar from './components/Sidebar';
import ExperienceSection from './components/journey/ExperienceSection';

function App() {
  return (
    <div className="grid grid-cols-3 gap-7 max-w-screen-lg mx-auto font-base">

      <div className="col-span-1 text-center pr-4 border-r-2 border-blue">
        {/* Sidebar component */}
        <Sidebar />
      </div>


      <div className="col-span-2 pl-4">
        {/* All experiences */}
        <ExperienceSection />
      </div>

    </div>
  );
}

export default App;
